observacao:
A) A Tabela Sigtap não é atualizada automaticamente por competência;
B) Relatório sintéticos e analíticos para os 07 indicadores do Programa PREVINE BRASIL;
C) Histórico de atendimento não possui um módulo de impressão adequado as necessidade JUDICIAIS.

Os atendimentos realizados não estarem no histórico do paciente é, sem dúvida o mais grave. 
Além disso: demora para carregar novos procedimentos; 
Carregamentos das telas (tela de prescrição, impressão,...) fora do campo de visão; Ao fechar uma tela, volta a tela anterior, mas com localização diferente de onde estava (tem que ficar procurando todas as vezes);

1-Sistema não atualiza atendimentos automaticamente. Sendo necessário atualização por parte do operador;
2-Sistema não possui todas as demandas de atendimento para fazer a ficha de atendimento do paciente. Necessário que mais opções sejam disponibilizadas;
3-Sistema de organização das ordens de chegada e imputs dos atendimentos é confuso e visualmente não agradável;
4-Apresenta dificuldades de comunicação com a base nacional do sus e recuperação de dados dos usuários;
